import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards to load
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Click the first product's "Add to Cart" button
    await page.click('.product-card .add-to-cart:first-of-type');

    // Wait for cart update notification
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_added_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_added_to_cart.png'));

    // Extract product title that was added to cart
    const productTitle = await page.$eval('.product-card .product-title:first-of-type', el => el.textContent.trim());

    // Extract cart count to verify addition
    const cartCount = await page.$eval('.cart', el => {
      const text = el.textContent.trim();
      return parseInt(text.match(/\d+/)[0]);
    });

    return {
      success: true,
      action: "Added first product to cart",
      extractedData: {
        productTitle,
        cartCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add first product to cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
